export class Producto{

    private Id: String;
    private Nombre: String;
    private Marca:String;
    private Sucursal:String;
    private Precio: number;
    private Pasillo: number;

    constructor(Id:String,Nombre:String, Marca:String,Precio:number,Pasillo:number){
        this.Id = Id;
        this.Nombre = Nombre; 
        this.Marca = Marca;
        this.Precio = Precio;
        this.Pasillo = Pasillo;
    }




    public getPrecio(): number {
        return this.Precio;
    }
    public getPasillo(): number {
        return this.Pasillo;
    }

    public getId(): String {
        return this.Id;
    }

    public getNombre(): String {
        return this.Nombre;
    }

    public getMarca():String{
        return this.Marca;
    }
    public getSucursal():String{
        return this.Sucursal;
    }



}
